class UnitParser {
    static parseTempUnit = (temp, unit) => {
        const suffix = this.state.unit === 'metric' ? '째C' : '째F'
        return temp + suffix;
    }

    static parseWindUnit = (speed, unit) => {
        let suffix;
        if (this.state.unit === 'metric') {
            speed = Math.round(speed * 3600 / 1000);
            suffix = 'km/h';
        } else {
            suffix = 'mi/h';
        }
        return speed + suffix;
    }

}
export default UnitParser;
